sourcesContent:
axios.get('http://localhost:8080/admin/claims', {
    headers: {
      'Authorization': 'Basic YWRtaW4xMjM6Y21z'
    }
  })
  .then(response => {
    // Assuming the response data is an array of claims
    const filteredClaims = response.data.filter(claim => claim.status !== 'Not Submitted');

    // Now you can display the filtered claims
    console.log(filteredClaims);

    // If you're using React, you can set the state to display these claims
    // this.setState({ claims: filteredClaims });
  })
  .catch(error => {
    console.error('Error fetching claims:', error);
  });
